import React from 'react'

export default function NavBar() {
  return (
    <nav className="navbar navbar-dark bg-dark">
    <div className="container">
      <a className="navbar-brand mx-auto" href="/">
        <h3>My App</h3>
      </a>
    </div>
  </nav>
    
  )
}
